import React from 'react';
import './Footer.css';

function Footer() {
    return (
        <footer className="footer">
            <ul className="footer__nav">
                <li className="footer__nav-item"><a className="footer__nav-link" href="/">Главная</a></li>
                <li className="footer__nav-item"><a className="footer__nav-link" href="https://praktikum.yandex.ru">Яндекс.Практикум</a></li>
                <li className="footer__nav-item"></li>
            </ul>
        </footer>
    )
}

export default Footer;
